import React, { useState, useEffect } from "react";
import Header from "../../component/Header/Header";
import "../../assets/css/FormHorario.css"; // Certifique-se de criar o arquivo CSS adequado

function FormHorario() {
  const [cursos, setCursos] = useState([]);
  const [periodos, setPeriodos] = useState([]);
  const [materias, setMaterias] = useState([]);
  const [salas, setSalas] = useState([]);
  const [professores, setProfessores] = useState([]);
  const [horario, setHorario] = useState({
    curso: "",
    periodo: "",
    materia: "",
    sala: "",
    professor: "",
    dia: "",
    horaInicio: "",
    horaFim: "",
  });

  useEffect(() => {
    // Aqui você deve carregar os cursos, períodos, matérias, salas e professores do seu backend ou de onde estiverem armazenados
    // Exemplo:
    // Carregar cursos
    // fetch("sua_api/cursos")
    //   .then(response => response.json())
    //   .then(data => setCursos(data))
    //   .catch(error => console.error("Erro ao carregar cursos", error));

    // O mesmo para períodos, matérias, salas e professores
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aqui você pode lidar com o envio do formulário, como enviar os dados para o backend
    console.log("Formulário enviado:", horario);
    // Limpar o formulário
    setHorario({
      curso: "",
      periodo: "",
      materia: "",
      sala: "",
      professor: "",
      dia: "",
      horaInicio: "",
      horaFim: "",
    });
  };

  return (
    <>
      <Header />
      <div className="section1FormHorario">
        <h1 className="tituloPagina">Cadastro de Horário</h1>
        <div className="conatinerFormHorario">
          <form onSubmit={handleSubmit}>
            <div className="divComboHorario">
              <label>Curso:</label>
              <select
                value={horario.curso}
                onChange={(e) => setHorario({ ...horario, curso: e.target.value })}
              >
                <option value="">Selecione o Curso</option>
                {cursos.map((curso, index) => (
                  <option key={index} value={curso}>
                    {curso}
                  </option>
                ))}
              </select>
            </div>
            {/* Repita o bloco de seleção para os outros campos (período, matéria, sala, professor) */}
            {/* Exemplo: */}
            <div className="divComboHorario">
              <label>Período:</label>
              <select
                value={horario.periodo}
                onChange={(e) => setHorario({ ...horario, periodo: e.target.value })}
              >
                <option value="">Selecione o Período</option>
                {periodos.map((periodo, index) => (
                  <option key={index} value={periodo}>
                    {periodo}
                  </option>
                ))}
              </select>
            </div>

            {/* Adicione campos de input para o restante das informações do horário */}
            <div className="divComboHorario">
              <label>Dia:</label>
              <input
                type="text"
                value={horario.dia}
                onChange={(e) => setHorario({ ...horario, dia: e.target.value })}
              />
            </div>
            <div className="divComboHorario">
              <label>Hora Início:</label>
              <input
                type="text"
                value={horario.horaInicio}
                onChange={(e) => setHorario({ ...horario, horaInicio: e.target.value })}
              />
            </div>
            <div className="divComboHorario">
              <label>Hora Fim:</label>
              <input
                type="text"
                value={horario.horaFim}
                onChange={(e) => setHorario({ ...horario, horaFim: e.target.value })}
              />
            </div>
            {/* Botão de envio do formulário */}
            <button type="submit">Salvar</button>
          </form>
        </div>
      </div>
    </>
  );
}

export default FormHorario;
